First, let's calculate the area of each of the two squares. Since each square has a side length of 2 units, the area of each square is:
\[
2 \times 2 = 4 \text{ square units}
\]

Next, we need to find the area of the right-angled triangle. The base of the triangle is the horizontal distance from \((0, 0)\) to \((2, 0)\), which is 2 units. The height of the triangle is the vertical distance from \((2, 0)\) to \((2, 4)\), which is 4 units. The area of a right-angled triangle is given by:
\[
\text{Area} = \frac{1}{2} \times \text{base} \times \text{height} = \frac{1}{2} \times 2 \times 4 = 4 \text{ square units}
\]

The shaded region consists of the two squares minus the area of the right-angled triangle. Therefore, the total surface area of the shaded region is:
\[
4 + 4 - 4 = 4 \text{ square units}
\]

Thus, the total surface area of the shaded region is:
\[
\boxed{8}
\]

